func TestAddTwoNumbers(t *testing.T) {
	testCases := []struct {
		title    string
		input    string
		expected int
	}{
		{title: "empty string", input: "", expected: 0},
		{title: "only space", input: " ", expected: 1},
		{title: "two letters", input: "aab", expected: 2},
		{title: "three letters", input: "abcabcbb", expected: 3},
		{title: "three letters again", input: "pwwkew", expected: 3},
		{title: "all the same letter", input: "bbbbb", expected: 1},
		{title: "enormous string", input: EnormousInput, expected: 95},
	}

	for _, test := range testCases {
		test := test

		t.Run(test.title, func(t *testing.T) {
			actual := LengthOfLongestSubstring(test.input)
			require.Equal(t, test.expected, actual)
		})
	}
}
